{"type":"root","children":[{"type":"paragraph","children":[{"type":"text","value":"The eyes often show the first signs of age, stress, lack of sleep and environmental aggressors. This multi-function eye cream is designed to help smooth the appearance of fine lines and wrinkles on this delicate skin plus help brighten the eye area. A firming complex gives the appearance of a “lift” in skin elasticity while hyaluronic acid attracts moisture to the skin. The result is a bright-eyed appearance. 

